import React from 'react';

function App(){
 return(
     <>
    <ul>
    <li>sum of two no is  {add(7,8)} </li>
    <li>sub of two no is  {sub(8,10)} </li>
    <li>mul of two no is {mul(10,10)}</li>
    <li>div of two no is {div(100,50)}</li>
</ul>
</>
 );  
}

export default App;
